import { configureStore } from "@reduxjs/toolkit";
import userReduce from '../features/userSlice'

export const store = confiqureStore({
    reducer:{ user: userReduce},
    middeware: (getDefaultMiddleware)=> getDefaultMiddleware({
        serializableCheck: false
    })
})
